import React from 'react';

import TeamiNfo from '../../Elements/teaminfo';

const Header = (props) => {


    const teamiNfo =(team) => {
        return team ? (
            <TeamiNfo team={teamData}/>
        ):null;
    }
    return (
        <div>
            {teamiNfo(props.teamData)}
        </div>
    )
}

export default Header;
